import React, {Component} from 'react'
import './App.css';
import ImportsModule from '../components/ImportsModule'

class App extends Component {

  render() {

    const name = 'pesho';

    return (

      <div className="App">

        <ImportsModule.Header name = {name}/>

        <ImportsModule.Content color='red'>

          Това което е тук отива в children където е дефиниран този компонент.

        </ImportsModule.Content>

        <ImportsModule.StateForComponentExample/>

        <br />

        <ImportsModule.ComponentLifeCycle/>
        <br />
        <ImportsModule.FormComponent/>
        <br />
        <br />

        <ImportsModule.Footer/>

      </div>
    )
  }

}

export default App;
